from sqlalchemy import Column, DateTime, Integer, Stringfrom sqlalchemy.schema import FetchedValuefrom application import dbclass Machine_Weimob(db.Model):    __tablename__ = 'machine_weimob'    id = db.Column(Integer, primary_key=True)    cardcode = db.Column(String(600), nullable=False, server_default=FetchedValue())    orderNo = db.Column(String(128), nullable=False, index=True, server_default=FetchedValue())    goods_name = db.Column(String(128), nullable=False, server_default=FetchedValue())    goodsId = db.Column(Integer, nullable=False, server_default=FetchedValue())    orderStatus = db.Column(Integer, nullable=False, server_default=FetchedValue())    createtime = db.Column(DateTime, nullable=False, server_default=FetchedValue())    wid = db.Column(Integer, nullable=False, server_default=FetchedValue())    userNickname = db.Column(String(128), nullable=False, server_default=FetchedValue())    pid = db.Column(Integer, nullable=False, server_default=FetchedValue())    merchantTitle = db.Column(String(128), nullable=False, server_default=FetchedValue())    goodscode = db.Column(String(128), nullable=False, server_default=FetchedValue())    storeId = db.Column(Integer, nullable=False, server_default=FetchedValue())    storeTitle = db.Column(String(128), nullable=False, server_default=FetchedValue())    processStoreTitle = db.Column(String(128), nullable=False, server_default=FetchedValue())    processStoreId = db.Column(Integer, nullable=False, server_default=FetchedValue())    selfPickupSiteId = db.Column(Integer, nullable=False, server_default=FetchedValue())